script: |
  super -f text -I q10916.spq | sort > q10916.out

inputs:
  - name: q10916.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL IS NULL AND NOT ( NOT - col0 NOT BETWEEN - + 51 AND + ( - col2 ) / - - 25 );
  - name: tab0

outputs:
  - name: q10916.out
    data: |
      87
      97
